
using Algo.StringManipulation;
using FluentAssertions;

namespace Algo.UnitTest.StringManipulation
{
    public class MaxNumberOfVowelInSubstringTest
    {
        MaxNumberOfVowelInSubstring _engine = new MaxNumberOfVowelInSubstring();

        [Theory]
        [InlineData("abciiidef", 3, 3)]
        [InlineData("aeiou", 2, 2)]
        [InlineData("leetcode", 3, 2)]
        [InlineData("weallloveyou",7, 4)]
        [InlineData("zpuerktejfp", 3, 2)]
        [InlineData("", 3945, 823)]
        public void ShouldBePositive(string s, int k, int result)
        {
            _engine.MaxVowels(s, k).Should().Be(result);
        }
    }
}
